window.addEventListener("load",function(){Gwdm()});function Gwdm(){desktop.open();login.open();if(Gwt.Core.Contrib.GetSessionId()!==null){start_session()}}function start_session(){login.close();gpanel.open();gcontrol.open();SessionRenueve=setInterval(window.renueve_session,60000);SessionEnv=setTimeout(window.terminate_session,60000*5);window.addEventListener("mousemove",function(){if(SessionEnv!==undefined){clearTimeout(SessionEnv);SessionEnv=setTimeout(window.terminate_session,60000*5)}});window.addEventListener("keypress",function(){if(SessionEnv!==undefined){clearTimeout(SessionEnv);SessionEnv=setTimeout(window.terminate_session,60000*5)}});renueve_session()}function terminate_session(){Gwt.Core.Contrib.CloseActiveApp();gpanel.close();block.open();clearTimeout(SessionEnv);SessionEnv=undefined;clearInterval(SessionRenueve);SessionRenueve=undefined;new Gwt.Core.Request("/backend/auth/terminatesession/",function(){},null,Gwt.Core.REQUEST_METHOD_GET)}function renueve_session(){if(Gwt.Core.Contrib.GetSessionId()!==null){new Gwt.Core.Request("/backend/auth/renuevesession/",function(){},null,Gwt.Core.REQUEST_METHOD_GET)}}function unlock_session(){block.close();login.open()}function LoadApp(c){var e=document.createElement("script");e.type="text/javascript";e.async=true;e.src="/frontend/bin/"+c+".min.js";var a=document.head;var d=true;for(var b=0;b<a.childNodes.length;b++){if(a.childNodes[b].src===e.src){d=false}}if(d===true){a.appendChild(e)}};